// src/components/TabBar/TabBar.stories.js

import React from 'react';
import TabBar from './TabBar';

export default {
  title: 'UI/ex/TabBar',
  component: TabBar,
};

const Template = (args) => <TabBar {...args} />;

export const Default = Template.bind({});
Default.args = {
  tabs: [
    { label: 'Tab 1', to: '/tab1' },
    { label: 'Tab 2', to: '/tab2' },
    { label: 'Tab 3', to: '/tab3' },
  ],
};
